import React from 'react';
import Balloons from '../assets/Home/balloons.png';

const Home = () => {
    return (
        <div className="home-wrapper">
            <navigation className="nav-bar">
                <div className="nav-contacts">
                    <img src={Balloons} alt="" width='45' />
                    <a href="">CONTACTS</a>
                </div>

                <div clasName="nav-items">
                    <a href="">HOME</a>
                    <a href="">PROJECTS</a>
                </div>
            </navigation>
        </div>
    )
}

export default Home;
